def subdomainVisits(self, cpdomains):
    c = collections.Counter()
    for d in cpdomains:
        n, d = d.split()
        dots = d.count('.')
        for i in range(dots + 1):
            c[d.split('.', i)[i]] += int(n)
    return ["%d %s" % (c[k], k) for k in c]
